import React from "react";
import { Container, Typography, Grid, Paper } from "@material-ui/core";

const ShowCourses = () => {
  return (
    <div style={{ backgroundColor: "#f7f7f7", minHeight: "100vh" }}>
      <Container maxWidth="lg" style={{ paddingTop: "50px" }}>
        <Typography variant="h2" align="center" style={{ color: "#da4ea2" }}>
          Want to learn something new?
        </Typography>
        <Typography variant="h2" align="center" style={{ color: "#da4ea2" }}>
          Enroll Now
        </Typography>
        <img
          src="./Images/smallLine.png"
          alt="smallLine"
          style={{ width: "30%", margin: "auto", display: "block" }}
        />
        <Grid container spacing={3} style={{ marginTop: "50px" }}>
          {courses.map((course) => (
            <Grid item xs={12} sm={6} md={4} key={course.id}>
              <Paper elevation={3} style={{ padding: "20px" }}>
                <img
                  src={course.image}
                  alt={course.title}
                  style={{ width: "100%" }}
                />
                <Typography variant="h5" style={{ marginTop: "10px" }}>
                  {course.title}
                </Typography>
                <Typography variant="body1" style={{ marginTop: "10px" }}>
                  {course.description}
                </Typography>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </div>
  );
};

const courses = [
  {
    id: 1,
    title: "Introduction to React",
    description: "Learn the basics of React and build your first app",
    image: "./Images/React.png",
  },
  {
    id: 2,
    title: "Web Development with Node.js",
    description: "Build dynamic web applications with Node.js and Express",
    image: "./Images/nodeJs.png",
  },
  {
    id: 3,
    title: "JavaScript Fundamentals",
    description:
      "Master the fundamentals of JavaScript and become a proficient developer",
    image: "./Images/javascript.png",
  },
  {
    id: 4,
    title: "Introduction to Python",
    description:
      "Master the best programming language of the world and create your own python scripts",
    image: "./Images/python.png",
  },
  {
    id: 5,
    title: "Introduction to C++",
    description:
      "Intoduction to most easiest prgramming langugae of the world. Enroll now and enjoy",
    image: "./Images/python.png",
  },
];

export default ShowCourses;
